<template>
  <div class="login-container">
    <div class="stars">
      <div class="star"
           v-for="(item, index) in starsCount"
           :key="index + 'star'"
           ref="star"></div>
      <div class="star3"
           v-for="(item, index) in starsCount"
           :key="index + 'star3'"
           ref="star"></div>
      <div class="star2"
           v-for="(item, index) in starsCount2"
           :key="index + 'star2'"
           ref="star2"></div>
    </div>
    <el-form ref="loginForm"
             :model="loginForm"
             :rules="loginRules"
             class="login-form"
             autocomplete="on"
             label-position="left">
      <div class="title-container">
        <img src="../../assets/dashboard/favicon.png"
             class="sidebar-logo" />
        <h3 class="title">微服务网关</h3>
      </div>

      <el-form-item prop="username">
        <span class="svg-container">
          <svg-icon icon-class="user" />
        </span>
        <el-input ref="username"
                  v-model="loginForm.username"
                  placeholder="用户名"
                  name="username"
                  type="text"
                  tabindex="1"
                  autocomplete="on" />
      </el-form-item>

      <el-tooltip v-model="capsTooltip"
                  content="Caps lock is On"
                  placement="right"
                  manual>
        <el-form-item prop="password">
          <span class="svg-container">
            <svg-icon icon-class="password" />
          </span>
          <el-input :key="passwordType"
                    ref="password"
                    v-model="loginForm.password"
                    :type="passwordType"
                    placeholder="密码"
                    name="password"
                    tabindex="2"
                    autocomplete="on"
                    @keyup.native="checkCapslock"
                    @blur="capsTooltip = false"
                    @keyup.enter.native="handleLogin" />
          <span class="show-pwd"
                @click="showPwd">
            <svg-icon :icon-class="passwordType === 'password' ? 'eye' : 'eye-open'" />
          </span>
        </el-form-item>
      </el-tooltip>
      <el-form-item prop="code"
                    style="width: 200px">
        <el-input ref="code"
                  key="logincode"
                  type="text"
                  placeholder="验证码"
                  name="code"
                  tabindex="3"
                  maxlength="6"
                  autocomplete="on"
                  v-model="loginForm.code" />
      </el-form-item>
      <el-image @click="changeCaptcha"
                :src="captcha.image"
                class="captcha"
                fit="contain"></el-image>
      <el-button :loading="loading"
                 type="primary"
                 style="width: 100%; margin-bottom: 30px"
                 @click.native.prevent="handleLogin">登 &nbsp;&nbsp; 录</el-button>

      <div style="position: relative">
        <div class="tips">
          &nbsp;&nbsp;
          &nbsp;&nbsp;&nbsp;&nbsp;<span>github&nbsp;:&nbsp;github.com/qingolang</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
          <span>email&nbsp;:&nbsp;ggolang@163.com</span>
        </div>
      </div>
    </el-form>
  </div>
</template>

<script>
import { validUsername } from "@/utils/validate";
import { captcha } from "@/api/captcha";
export default {
  name: "Login",
  components: {},
  data () {
    const validateUsername = (rule, value, callback) => {
      if (!validUsername(value)) {
        callback(new Error("请输入正确的用户名"));
      } else {
        callback();
      }
    };
    const validatePassword = (rule, value, callback) => {
      if (value.length < 6) {
        callback(new Error("密码不能小于6位"));
      } else {
        callback();
      }
    };
    const validateCode = (rule, value, callback) => {
      if (value.length < 6) {
        callback(new Error("验证码不能小于6位"));
      } else {
        callback();
      }
    };
    return {
      starsCount: 20, //数量
      starsCount2: 800, //数量
      distance: 500, //间距
      distance2: 800, //间距
      captcha: {
        id: "",
        image: "",
      },
      loginForm: {
        username: "",
        password: "",
        code: "",
        codeId: ""
      },
      loginRules: {
        username: [
          { required: true, trigger: "blur", validator: validateUsername },
        ],
        password: [
          { required: true, trigger: "blur", validator: validatePassword },
        ],
        code: [{ required: true, trigger: "blur", validator: validateCode }],
      },
      passwordType: "password",
      capsTooltip: false,
      loading: false,
      showDialog: false,
      redirect: undefined,
      otherQuery: {},
    };
  },
  watch: {
    $route: {
      handler: function (route) {
        const query = route.query;
        if (query) {
          this.redirect = query.redirect;
          this.otherQuery = this.getOtherQuery(query);
        }
      },
      immediate: true,
    },
  },
  mounted () {
    let starArr = this.$refs.star;
    starArr.forEach((item) => {
      var speed = 0.2 + Math.random() * 1;
      var distance = this.distance + Math.random() * 300;
      item.style.transformOrigin = `0 0 ${distance}px`;
      item.style.transform = `translate3d(0,0,-${distance}px) rotateY(${Math.random() * 360
        }deg) rotateX(${Math.random() * -50}deg) scale(${speed},${speed})`;
    });

    let starArr2 = this.$refs.star2;
    starArr2.forEach((item) => {
      var speed = 0.2 + Math.random() * 1;
      var distance2 = this.distance2 + Math.random() * 300;
      item.style.transformOrigin = `0 0 ${distance2}px`;
      item.style.transform = `translate3d(0,0,-${distance2}px) rotateY(${Math.random() * 360
        }deg) rotateX(${Math.random() * -50}deg) scale(${speed},${speed})`;
    });

    if (this.loginForm.username === "") {
      this.$refs.username.focus();
    } else if (this.loginForm.password === "") {
      this.$refs.password.focus();
    }
  },
  methods: {
    async changeCaptcha () {
      this.loading = true;
      let capRes = await captcha();
      if (capRes.errno == 0) {
        this.captcha.id = capRes.data.id;
        this.captcha.image = capRes.data.image;
      }
      this.loading = false;
    },
    checkCapslock (e) {
      const { key } = e;
      this.capsTooltip = key && key.length === 1 && key >= "A" && key <= "Z";
    },
    showPwd () {
      if (this.passwordType === "password") {
        this.passwordType = "";
      } else {
        this.passwordType = "password";
      }
      this.$nextTick(() => {
        this.$refs.password.focus();
      });
    },
    handleLogin () {
      this.loginForm.codeId = this.captcha.id
      this.$refs.loginForm.validate((valid) => {
        if (valid) {
          this.loading = true;

          this.$store
            .dispatch("user/login", this.loginForm)
            .then(() => {
              this.$router.push({
                path: this.redirect || "/",
                query: this.otherQuery,
              });
              this.loading = false;
            })
            .catch(() => {
              this.loading = false;
            });
        } else {
          // console.log("error submit!!");
          return false;
        }
      });
    },
    getOtherQuery (query) {
      return Object.keys(query).reduce((acc, cur) => {
        if (cur !== "redirect") {
          acc[cur] = query[cur];
        }
        return acc;
      }, {});
    },
  },
  async created () {
    this.loading = true;
    let capRes = await captcha();
    if (capRes.errno == 0) {
      this.captcha.id = capRes.data.id;
      this.captcha.image = capRes.data.image;
    }
    this.loading = false;
  },
};
</script>

